import styles from "../css/Menubar.module.css";
import menuIcon from "../assets/icon-menu.svg";

const Menubar = () =>{
    return (
        <nav className={styles.menubar}>
            <img src={menuIcon} alt="menu icon" />
            <div>Burger</div>
            <div>Logo</div>
            <div>Cart</div>
            <div>Identity</div>
        </nav>
    )

}

export default Menubar;
